  const [file, setFile] = useState(null);

  const submitForm = () => {};

  return (




    <div>
      <form>
        <input type="file" value= {file} onChange={(props) => setFile(props.target.files[0])}/>
        <button type="submit" onClick={submitForm}>Load</button>
      </form>
    </div>
  );
}

export default App;
